import React, { cloneElement } from 'react';
import { Link } from 'react-router-dom';
import './Menu.css'

function Menu() {
  const closeMenu = () => {
    const body = document.querySelector('body');
    if (body.getAttribute('class') === 'menu-active')
    body.classList.remove('menu-active');
  }


  return (
    <div className='menu'>
      <ul>
        <li>
          <input type="text" placeholder='Search'/>
          <div>Menu</div>
        </li>
        <li>
          <Link to='/ecommerce/collections/new-arrivals' onClick={()=>closeMenu()}>New Arrivals</Link>
        </li>
        <li>
          <Link to='/ecommerce/collections/home-bath'>Home + Bath</Link>
        </li>
        <li>
          <Link to='/ecommerce/collections/kitchen-dinning'>Kitchen + Dinning</Link>
        </li>
        <li>
          <Link to='/ecommerce/collections/office-craft'>Office + Craft</Link>
        </li>
        <li>
          <Link to='/ecommerce/collections/personal-goods'>Personal-Goods</Link>
        </li>
      </ul>
    </div>
  );
}

export default Menu;
